    return (
        <>
            <div className="picture_card">
                <img src={props.src} className="src1"></img>
                <img src="./sweep2.1.png" className="src2"></img>
                <img src="./sweep2.2.png" className="src3"></img>

            </div>


        </>
    );
}

export default ProjectPictures;
